import React from "react";
import "./nav.css";
import { NavLink } from "react-router-dom";

const Nav = () => {
  return (
    <div className="nav">
      <div className="firstnav">logo</div>
      <div className="middlenav">
        <NavLink exact to="/contact">
          <p></p>
          HOME
        </NavLink>
        <NavLink exact to="/journey">
          THE JOURNEY
        </NavLink>
        <NavLink exact to="/team">
          TEAM
        </NavLink>
        <NavLink exact to="/allproducts">
          STORE
        </NavLink>
        <NavLink exact to="/contact">
          CONTACT
        </NavLink>
      </div>
      <div className="lastnav"></div>
    </div>
  );
};

export default Nav;
